      <header className="app-header">
        <h1 className="title">YouTube Video Player</h1>
      </header>
      <main className="app-content">
        <VideoPlayer />
      </main>
      <footer className="app-footer">
        <p>&copy; 2023 Your App Name. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
